export const colors = {
  palette: [
    {
      // orange0
      text: "#f97316",
      bgColor: (opacity) => `rgba(251, 146, 60, ${opacity})`,
    },
    {
      // dark gray1
      text: "#334155",
      bgColor: (opacity) => `rgba(30, 41, 59, ${opacity})`,
    },
    {
      // purple2
      text: "#7c3aed",
      bgColor: (opacity) => `rgba(167, 139, 250, ${opacity})`,
    },
    {
      // green3
      text: "#009950",
      bgColor: (opacity) => `rgba(0, 179, 89, ${opacity})`,
    },
    {
      // teal4
      text: "#14b8a6",
      bgColor: (opacity) => `rgba(45, 212, 191, ${opacity})`,
    },
    {
      // red5
      text: "#dc2626",
      bgColor: (opacity) => `rgba(248, 113, 113, ${opacity})`,
    },
    {
      // yellow6
      text: "#FFD700",
      bgColor: (opacity) => `rgba(255,215,0, ${opacity})`,
    },
    {
      // goldenrod7
      text: "#DAA520",
      bgColor: (opacity) => `rgba(218,165,32, ${opacity})`,
    },
  ],

  text: {
    primary: "#262626",
    secondary: "#757575",
    disabled: "#9C9C9C",
    inverse: "#FFFFFF",
    error: "#D0421B",
    success: "#138000",
  },
};
